import React from 'react'
import { Link } from 'react-router-dom';

const onLogIn = () => {
    return(
        <>
            <li class="nav-item"><Link className="nav-link btn btn-secondary bg-secondary p-1 mb-1 ml-1" style={{fontSize: "10px", width: '80px'}} to="/login">Login</Link></li>
            <li class="nav-item"><Link className="nav-link btn btn-light bg-dark ml-1 p-1" style={{fontSize: "10px", width: '80px'}} to="/register">Register</Link></li>                
        </>
    );
}

export default onLogIn;
